<html>
<head>
	<title> Ezra's Project 2 - Cycle animation</title>

	<!-- Creates a simple animation of a bird that follows a spline -->

	<!-- This is a minimal library that is basically syntactic sugar for some WebGL setup tasks. -->
	<!-- It's much simpler than three.js -->
	<!-- http://twgljs.org/ -->
	<script type="text/javascript" src="./twgl.js"></script>

	<!-- This is a library that adds WebGL style matrix and quaternion operations. -->
	<!-- http://glmatrix.net -->
	<script type="text/javascript" src="./gl-matrix.js"></script>

	<!-- Fragment Shader - very simple -->
	<script id="fs" type="x-shader/x-fragment">
	precision mediump float;
	varying vec4 color;
	void main() {
		gl_FragColor = color;
	}
	</script>

	<!-- Vertex Shader - sets color based on vertex position. -->
	<script id="vs" type="x-shader/x-vertex">
	attribute vec4 position;
	varying vec4 color;
	uniform mat4 modelMat;

	void main() {
		color = position;
		gl_Position = modelMat * position;
	}
	</script>

	<script type="text/javascript" src="./Quaternion.js"></script>
	<script type="text/javascript" src="./readSpline.js"></script>
	<script type="text/javascript" src="./readOBJ.js"></script>

	<script type="text/javascript" src="./interpolate.js"></script>


	<script type="text/javascript">

	// List of objects in the scene.
	// Each object is in the form of:
	// {
	//  name: "string"
	//	position:[1.0,2.0,3.0],
	//  indices: [1,2,3],
	//  bufferInfo: [1,2,3],
	//  getLocation: function(time) { returns matrix },
	// }
	var objects = [];

	var arrays = {
		position: [],
		indices: []
	};

	var gl; // The webgl context of the primary canvas
	// The current program uses a single webgl program.
	// Both of these are twgl objects
	var programInfo;

	// List of paths used in this scene
	var splines = [];


	// Sets up objects inheriting from others
	// Specific to this scene
	function setupObjectHierarchy(objects) {
		// Setup object hierarchy
		function findByName(name) {
			return objects.find(function(o) {
				return o.name == name;
			});
		}

		findByName('inner-wing-1').parent = findByName('body');
		findByName('middle-wing-1').parent = findByName('inner-wing-1');
		findByName('outer-wing-1').parent = findByName('middle-wing-1');

		findByName('body').spline = splines[1];
		findByName('inner-wing-1').spline = splines[2];
		findByName('middle-wing-1').spline = splines[3];
		findByName('outer-wing-1').spline = splines[4];


		findByName('inner-wing-2').parent = findByName('body');
		findByName('middle-wing-2').parent = findByName('inner-wing-2');
		findByName('outer-wing-2').parent = findByName('middle-wing-2');

		findByName('inner-wing-2').spline = splines[5];
		findByName('middle-wing-2').spline = splines[6];
		findByName('outer-wing-2').spline = splines[7];

	}

	// Sets up the objects variable for rendering.
	function setupObjects(objects) {

		// Allows getting the location of each object
		function objectGetLocation(time) {
			var spline = this.spline || splines[0];

			var modelMat;
			if(this.parent) {
				modelMat = this.parent.getLocation(time);
			} else { // root object
				modelMat = mat4.create();
				mat4.rotateX(modelMat, modelMat, -3.1415/3);
				mat4.scale(modelMat, modelMat, [0.05, 0.05, 0.05]);
			}
			mat4.translate(modelMat, modelMat, getLocation([spline], time/1000));
			mat4.multiply(modelMat, modelMat, getRotation([spline], time/1000));
			return modelMat;
		}

		// Add attributes to objects
		objects.forEach(function(o) {
			o.bufferInfo = twgl.createBufferInfoFromArrays(gl, {
				position: o.position,
				indices: o.indices,
			});
			o.getLocation = objectGetLocation;
		});

		setupObjectHierarchy(objects);
	}

	// Starts up the animation and initializes variables
	function start() {
		var canvas = document.querySelector('canvas#project-canvas');
		gl = canvas.getContext('webgl');

		programInfo = twgl.createProgramInfo(gl, ['vs', 'fs']);

		splines = readSpline();

		objects = readOBJ();
		setupObjects(objects);

		requestAnimationFrame(render);
	}

	// Renders a frame of the animation. Intended to be called  via requestAnimationFrame()
	function render(time) {
		// note: time = performance.now()

		// Setup canvas
		twgl.resizeCanvasToDisplaySize(gl.canvas);
		gl.viewport(0, 0, gl.canvas.width, gl.canvas.width);
		gl.enable(gl.DEPTH_TEST);
		gl.depthFunc(gl.LESS);
		gl.useProgram(programInfo.program);

		var uniforms = {
			modelMat: mat4.create(),
		};

		// Render each object
		objects.forEach(function(o) {
			twgl.setBuffersAndAttributes(gl, programInfo, o.bufferInfo);
			uniforms.modelMat = o.getLocation(time);
			twgl.setUniforms(programInfo, uniforms);

			twgl.drawBufferInfo(gl, gl.TRIANGLES, o.bufferInfo);
		});
		
		// Request the next frame
		requestAnimationFrame(render);
	}

	</script>

	<link rel="stylesheet" href="style.css">
</head>
